package main

import (
	"context"
	"fmt"
	v1 "k8s.io/apimachinery/pkg/apis/meta/v1"
	"k8s.io/client-go/tools/clientcmd"
	"testing"
	"traefik-client/pkg/provider/kubernetes/crd"
	"traefik-client/pkg/provider/kubernetes/crd/generated/clientset/versioned"
)

func TestKubeConfig(t *testing.T)  {
	provider := crd.Provider{}
	provider.ConfigBytes = []byte(`apiVersion: v1
clusters:
  - cluster:
      certificate-authority-data: 
      server: https://127.0.0.1:6443
    name: kubernetes
contexts:
  - context:
      cluster: kubernetes
      user: kubernetes-admin
    name: kubernetes-admin@kubernetes
current-context: kubernetes-admin@kubernetes
kind: Config
preferences: {}
users:
  - name: kubernetes-admin
    user:
      client-certificate-data: 
      client-key-data: `)

	client, err := provider.NewK8sClient(context.Background())
	if err != nil {
		fmt.Println(err)
		return
	}


	ingressRoute, err := client.CsCrd.TraefikV1alpha1().IngressRoutes("default").List(context.Background(),v1.ListOptions{})
	if err != nil {
		fmt.Println(err)
		return
	}

	fmt.Println(ingressRoute)
}

func TestTraefikClient(t *testing.T)  {
	configBytes := []byte(`apiVersion: v1
clusters:
  - cluster:
      certificate-authority-data: 
      server: https://127.0.0.1:6443
    name: kubernetes
contexts:
  - context:
      cluster: kubernetes
      user: kubernetes-admin
    name: kubernetes-admin@kubernetes
current-context: kubernetes-admin@kubernetes
kind: Config
preferences: {}
users:
  - name: kubernetes-admin
    user:
      client-certificate-data: 
      client-key-data: `)
	config, err := clientcmd.RESTConfigFromKubeConfig(configBytes)
	if err != nil {
		fmt.Println(err)
		return
	}

	clientset, err := versioned.NewForConfig(config)
	if err != nil {
		fmt.Println(err)
		return
	}

	ingressRoute, err := clientset.TraefikV1alpha1().IngressRoutes("default").List(context.Background(),v1.ListOptions{})
	if err != nil {
		fmt.Println(err)
		return
	}

	fmt.Println(ingressRoute)

}